import React, { useState, useContext, useEffect } from 'react'
import { useHistory, Link } from 'react-router-dom'
import { AuthContext } from '../contexts/AuthContext'
import { createUserWithEmailAndPassword } from 'firebase/auth'
import { doc, setDoc } from 'firebase/firestore'
import { auth, db } from '../firebaseInit'
import { PersonAdd } from '@mui/icons-material'
import Loading from '../components/Loading'
import { globalIconStyle } from '../assets/GlobalStyles'
import { Switch as MaterialSwitch } from '@mui/material'
import PhoneInput from 'react-phone-input-2'
import 'react-phone-input-2/lib/style.css'

const SignUp = () => {
    const history = useHistory()
    const { setIsProvider } = useContext(AuthContext)
    const [loading, setLoading] = useState(false)
    const [showProviderForm, setShowProviderForm] = useState(false)

    const [userSignUpState, setUserSignUpState] = useState({
        name: '',
        userEmail: '',
        userPassword: '',
        userConfirmPassword: '',
        userNumber: ''
    })

    const [providerSignUpState, setProviderSignUpState] = useState({
        name: '',
        providerCompanyName: '',
        providerEmail: '',
        providerNumber: '',
        providerDescription: '',
        providerPassword: '',
        providerConfirmPassword: ''
    })

    const handleUserChange = (e) => {
        setUserSignUpState({
            ...userSignUpState,
            [e.target.name]: e.target.value
        })
    }

    const handleProviderChange = (e) => {
        setProviderSignUpState({
            ...providerSignUpState,
            [e.target.name]: e.target.value
        })
    }

    const handleSwitchCheck = (e) => {
        setShowProviderForm(e.target.checked)
    }

    const onUserSignUpSubmit = async (e) => {
        e.preventDefault()
        if (userSignUpState.name && userSignUpState.userEmail && userSignUpState.userPassword && userSignUpState.userConfirmPassword) {
            if (userSignUpState.userPassword === userSignUpState.userConfirmPassword) {
                setLoading(true)
                setIsProvider(false)
                try {
                    const userResponse = await createUserWithEmailAndPassword(auth, userSignUpState.userEmail, userSignUpState.userPassword)
                    const finalUser = userResponse.user
                    await setDoc(doc(db, 'users', finalUser.uid), {
                        name: userSignUpState.name,
                        userEmail: userSignUpState.userEmail,
                        userNumber: userSignUpState.userNumber || 'Not Specified'
                    })
                    alert(`Successfully created user with userId: ${finalUser.uid}`)
                    history.push('/')
                } catch (error) {
                    alert(`Error! Code ${error.code}: ${error.message}`)
                }
                setLoading(false)
            } else {
                alert('Entered passwords do not match.')
            }
        } else {
            alert('Please fill in all the fields.')
        }
    }

    const onProviderSignUpSubmit = async (e) => {
        e.preventDefault()
        if (providerSignUpState.name && providerSignUpState.providerEmail && providerSignUpState.providerCompanyName && providerSignUpState.providerDescription && providerSignUpState.providerPassword && providerSignUpState.providerConfirmPassword) {
            if (providerSignUpState.providerPassword === providerSignUpState.providerConfirmPassword) {
                setLoading(true)
                setIsProvider(true)
                try {
                    const providerResponse = await createUserWithEmailAndPassword(auth, providerSignUpState.providerEmail, providerSignUpState.providerPassword)
                    const finalProvider = providerResponse.user
                    await setDoc(doc(db, 'providers', finalProvider.uid), {
                        name: providerSignUpState.name,
                        providerCompanyName: providerSignUpState.providerCompanyName,
                        providerEmail: providerSignUpState.providerEmail,
                        providerNumber: providerSignUpState.providerNumber,
                        providerDescription: providerSignUpState.providerDescription
                    })
                    alert(`Successfully created provider with userId: ${finalProvider.uid}`)
                    history.push('/')
                } catch (error) {
                    alert(`Error! Code ${error.code}: ${error.message}`)
                }
                setLoading(false)
            } else {
                alert('Entered passwords do not match.')
            }
        } else {
            alert('Please fill in all the fields.')
        }
    }

    return (
        <div className='eightyperc-container'>
            <div className='card-type1 signup-card signup-card2'>
                <div className='flex-row'>
                    <p>Sign up as a Service Provider?</p>
                    <MaterialSwitch checked={showProviderForm} onChange={handleSwitchCheck} color='primary' />
                </div>
            </div>
            {showProviderForm ? (
                <ProviderSignUpForm
                    providerSignUpState={providerSignUpState}
                    handleProviderChange={handleProviderChange}
                    onProviderSignUpSubmit={onProviderSignUpSubmit}
                    loading={loading}
                />
            ) : (
                <UserSignUpForm
                    userSignUpState={userSignUpState}
                    handleUserChange={handleUserChange}
                    onUserSignUpSubmit={onUserSignUpSubmit}
                    loading={loading}
                />
            )}
            <div className='card-type1 signup-card signup-card2'>
                <p>Existing user? <Link to='/login' className='blue-link'>Log in</Link> instead.</p>
            </div>
        </div>
    )
}

export default SignUp
